import React, { useEffect } from 'react';
import { useRouter } from 'next/router';

const Details = () => {
  const router = useRouter();
  const { id } = router.query;

  useEffect(() => {
    console.log(router.query);
  }, []);

  return (
    <h1>{id}</h1>
  )
};

export default Details;
